import React from 'react';
import classes from '../postinfo/postinfo.module.css';

export default (props) => {
    return(
        <div className={classes.post}> 
            <div className={classes.firstdiv}>
                <b> {props.author}</b>
                <span> {props.date}</span>
            </div>
            <div className={classes.seconddiv}>
                <p>{props.disc}</p>
            </div>
        </div> 
    );
}
